script: |
  super -f text -I q9751.spq | sort > q9751.out

inputs:
  - name: q9751.spq
    data: |
      SELECT DISTINCT + col2 AS col1 FROM tab2 (FORMAT parquet) cor0 WHERE NOT - col1 / - + CAST ( + 19 AS INTEGER ) + - 45 + + 10 * col1 NOT BETWEEN + col2 AND NULL;
  - name: tab2

outputs:
  - name: q9751.out
    data: |
